import React, { useState } from 'react';

const Sectors = () => {
  const [modalOpen, setModalOpen] = useState(null);

  const handleModalOpen = (index) => {
    setModalOpen(index);
  };

  const handleModalClose = () => {
    setModalOpen(null);
  };
  const handleContentWindowOpen = () => {
    setContentWindowOpen(true);
  };

  // Handle closing the content window
  const handleContentWindowClose = () => {
    setContentWindowOpen(false);
  };
  return (
    <div
      id="sectors"
      style={{
        paddingTop: '5rem',
        paddingBottom: '5rem',
        backgroundImage: 'linear-gradient(to bottom left, #FFF4E6, #FFFFFF, #E4F9D9)',
      }}
    >
      <div style={{ maxWidth: '80rem', margin: '0 auto', paddingLeft: '1rem', paddingRight: '1rem' }}>
        <div style={{ textAlign: 'center', marginBottom: '4rem' }}>
          <h2
            style={{
              fontSize: '1.875rem',
              fontWeight: '700',
              color: '#1F2937',
            }}
          >
            <span
              style={{
                color: '#FB923C',
                fontSize: '2.5rem',
                fontWeight: '700',
              }}
            >
              Our Objectives
            </span>
          </h2>
          <p
            style={{
              marginTop: '1rem',
              fontSize: '1.25rem',
              color: '#4B5563',
            }}
          >
            The objectives of AIFBF are to promote economic growth, enhance financial systems, and equip stakeholders
            with the necessary skills to drive sustainable development and contribute to India's GDP.
          </p>
        </div>
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(250px, 1fr))', gap: '2rem' }}>
          {/* Growth */}
          <div
            style={{
              opacity: 1,
              transform: 'none',
            }}
          >
            <div
              style={{
                padding: '1.5rem',
                backgroundColor: 'rgba(255, 255, 255, 0.5)',
                backdropFilter: 'blur(10px)',
                borderRadius: '0.5rem',
                boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
                position: 'relative',
                cursor: 'pointer',
                transition: 'all 0.3s ease-in-out',
              }}
            >
              <div
                style={{
                  marginBottom: '1rem',
                  transition: 'transform 0.3s ease',
                }}
              >
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  width="24"
                  height="24"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  style={{
                    height: '3rem',
                    width: '3rem',
                    color: '#FB923C',
                  }}
                >
                  <rect width="20" height="14" x="2" y="7" rx="2" ry="2"></rect>
                  <path d="M16 21V5a2 2 0 0 0-2-2h-4a2 2 0 0 0-2 2v16"></path>
                </svg>
              </div>
              <h3
                style={{
                  fontSize: '1.25rem',
                  fontWeight: '600',
                  color: '#1F2937',
                  marginBottom: '0.5rem',
                }}
              >
                Growth
              </h3>
              <button
                onClick={() => handleModalOpen(1)}
                style={{
                  position: 'absolute',
                  bottom: '1rem',
                  right: '1rem',
                  paddingLeft: '1rem',
                  paddingRight: '1rem',
                  paddingTop: '0.5rem',
                  paddingBottom: '0.5rem',
                  backgroundColor: 'transparent',
                  color: '#FB923C',
                  border: '1px solid #FB923C',
                  borderRadius: '0.375rem',
                  transition: 'all 0.3s ease',
                }}
              >
                Learn More
              </button>
            </div>
          </div>

          {/* Excellence */}
          <div
            style={{
              opacity: 1,
              transform: 'none',
            }}
          >
            <div
              style={{
                padding: '1.5rem',
                backgroundColor: 'rgba(255, 255, 255, 0.5)',
                backdropFilter: 'blur(10px)',
                borderRadius: '0.5rem',
                boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
                position: 'relative',
                cursor: 'pointer',
                transition: 'all 0.3s ease-in-out',
              }}
            >
              <div
                style={{
                  marginBottom: '1rem',
                  transition: 'transform 0.3s ease',
                }}
              >
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  width="24"
                  height="24"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  style={{
                    height: '3rem',
                    width: '3rem',
                    color: '#4B5563',
                  }}
                >
                  <path d="M16 21v-2a4 4 0 0 0-4-4H6a4 4 0 0 0-4 4v2"></path>
                  <circle cx="9" cy="7" r="4"></circle>
                  <path d="M22 21v-2a4 4 0 0 0-3-3.87"></path>
                  <path d="M16 3.13a4 4 0 0 1 0 7.75"></path>
                </svg>
              </div>
              <h3
                style={{
                  fontSize: '1.25rem',
                  fontWeight: '600',
                  color: '#1F2937',
                  marginBottom: '0.5rem',
                }}
              >
                Excellence
              </h3>
              <button
                onClick={() => handleModalOpen(2)}
                style={{
                  position: 'absolute',
                  bottom: '1rem',
                  right: '1rem',
                  paddingLeft: '1rem',
                  paddingRight: '1rem',
                  paddingTop: '0.5rem',
                  paddingBottom: '0.5rem',
                  backgroundColor: 'transparent',
                  color: '#4B5563',
                  border: '1px solid #4B5563',
                  borderRadius: '0.375rem',
                  transition: 'all 0.3s ease',
                }}
              >
                Learn More
              </button>
            </div>
          </div>

          {/* Impact */}
          <div
            style={{
              opacity: 1,
              transform: 'none',
            }}
          >
            <div
              style={{
                padding: '1.5rem',
                backgroundColor: 'rgba(255, 255, 255, 0.5)',
                backdropFilter: 'blur(10px)',
                borderRadius: '0.5rem',
                boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
                position: 'relative',
                cursor: 'pointer',
                transition: 'all 0.3s ease-in-out',
              }}
            >
              <div
                style={{
                  marginBottom: '1rem',
                  transition: 'transform 0.3s ease',
                }}
              >
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  width="24"
                  height="24"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  style={{
                    height: '3rem',
                    width: '3rem',
                    color: '#FB923C',
                  }}
                >
                  <path d="M21 16V8a2 2 0 0 0-1-1.73l-7-4a2 2 0 0 0-2 0l-7 4A2 2 0 0 0 3 8v8a2 2 0 0 0 1 1.73l7 4a2 2 0 0 0 2 0l7-4A2 2 0 0 0 21 16z"></path>
                  <circle cx="12" cy="12" r="4"></circle>
                </svg>
              </div>
              <h3
                style={{
                  fontSize: '1.25rem',
                  fontWeight: '600',
                  color: '#1F2937',
                  marginBottom: '0.5rem',
                }}
              >
                Impact
              </h3>
              <button
                onClick={() => handleModalOpen(3)}
                style={{
                  position: 'absolute',
                  bottom: '1rem',
                  right: '1rem',
                  paddingLeft: '1rem',
                  paddingRight: '1rem',
                  paddingTop: '0.5rem',
                  paddingBottom: '0.5rem',
                  backgroundColor: 'transparent',
                  color: '#FB923C',
                  border: '1px solid #FB923C',
                  borderRadius: '0.375rem',
                  transition: 'all 0.3s ease',
                }}
              >
                Learn More
              </button>
            </div>
          </div>

          {/* Innovation */}
          <div
            style={{
              opacity: 1,
              transform: 'none',
            }}
          >
            <div
              style={{
                padding: '1.5rem',
                backgroundColor: 'rgba(255, 255, 255, 0.5)',
                backdropFilter: 'blur(10px)',
                borderRadius: '0.5rem',
                boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
                position: 'relative',
                cursor: 'pointer',
                transition: 'all 0.3s ease-in-out',
              }}
            >
              <div
                style={{
                  marginBottom: '1rem',
                  transition: 'transform 0.3s ease',
                }}
              >
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  width="24"
                  height="24"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  style={{
                    height: '3rem',
                    width: '3rem',
                    color: '#4B5563',
                  }}
                >
                  <path d="M21 21V3H3v18h18z"></path>
                  <path d="M12 7V3h4v4h-4zm0 14v-4h4v4h-4zm0-10V7h4v4h-4zm-8 0V7h4v4H4z"></path>
                </svg>
              </div>
              <h3
                style={{
                  fontSize: '1.25rem',
                  fontWeight: '600',
                  color: '#1F2937',
                  marginBottom: '0.5rem',
                }}
              >
                Innovation
              </h3>
              <button
                onClick={() => handleModalOpen(4)}
                style={{
                  position: 'absolute',
                  bottom: '1rem',
                  right: '1rem',
                  paddingLeft: '1rem',
                  paddingRight: '1rem',
                  paddingTop: '0.5rem',
                  paddingBottom: '0.5rem',
                  backgroundColor: 'transparent',
                  color: '#4B5563',
                  border: '1px solid #4B5563',
                  borderRadius: '0.375rem',
                  transition: 'all 0.3s ease',
                }}
              >
                Learn More
              </button>
            </div>
          </div>

          {/* Modals */}
          {modalOpen && (
            <div
              style={{
                position: 'fixed',
                top: 0,
                left: 0,
                width: '100%',
                height: '100%',
                backgroundColor: 'rgba(0, 0, 0, 0.6)',
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                zIndex: 9999,
              }}
            >
              <div
                style={{
                  backgroundColor: '#fff',
                  padding: '2rem',
                  borderRadius: '0.5rem',
                  maxWidth: '600px',
                  width: '100%',
                }}
              >
                <h2
                  style={{
                    fontSize: '1.875rem',
                    fontWeight: '700',
                    color: '#1F2937',
                    textAlign: 'center',
                    marginBottom: '2rem',
                  }}
                >
                  Learn More About {['Growth', 'Excellence', 'Impact', 'Innovation'][modalOpen - 1]}
                </h2>
                <p style={{ fontSize: '1.125rem', color: '#4B5563', marginBottom: '1.5rem' }}>
                  Here you can learn more about how {['growth', 'excellence', 'impact', 'innovation'][modalOpen - 1]} 
                  can be achieved in various sectors and the strategies for driving economic development.
                </p>

                {/* Images */}
                <div style={{ display: 'flex', justifyContent: 'space-around', marginBottom: '1.5rem' }}>
                  <img
                    src="https://via.placeholder.com/150"
                    alt={`Objective ${modalOpen} Image 1`}
                    style={{ width: '48%', borderRadius: '0.375rem' }}
                  />
                  <img
                    src="https://via.placeholder.com/150"
                    alt={`Objective ${modalOpen} Image 2`}
                    style={{ width: '48%', borderRadius: '0.375rem' }}
                  />
                </div>

                <button
                  onClick={handleModalClose}
                  style={{
                    width: '100%',
                    padding: '0.75rem',
                    backgroundColor: '#FB923C',
                    color: '#fff',
                    border: 'none',
                    borderRadius: '0.375rem',
                    fontSize: '1.125rem',
                    cursor: 'pointer',
                    transition: 'background-color 0.3s ease',
                  }}
                >
                  Close
                </button>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Sectors;
